	add("epicurus", "{\"term\":\"epicurus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin {{m|la|Epicūrus}}, from Ancient greek (to 1453) \u0027ἐπίκουρος\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An ancient Greek philosopher, founder of the movement commonly known as Epicureanism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("epicycle", "{\"term\":\"epicycle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027epicyclus\u0027 from Ancient greek (to 1453) \u0027ἐπίκυκλος\u0027 from \u0027ἐπί\u0027 (upon) + \u0027κύκλος\u0027 (circle)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small circle whose centre is on the circumference of a larger circle; in Ptolemaic astronomy it was seen as the basis of revolution of the \u0026quot;seven planets\u0026quot;, given a fixed central Earth\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Folio Society, 2006, vol.1, p.155\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Is it not [Philosophie], thatteacheth miserie, famine and sicknesse to laugh? Not by reason of some imaginarie \u0027\u0027Epicicles\u0027\u0027, but by naturall and palpable reasons\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any circle whose circumference rolls around that of another circle, thus creating a hypocycloid or epicycloid\", \"priority\":4}]}, \"synonyms\":{}}");

	add("epidemiology", "{\"term\":\"epidemiology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From epidemia + οlogy, from Ancient greek (to 1453) \u0027επιδημία\u0027 + \u0027λόγος\u0027 from επί (upon) and δήμος (people) (disease upon people and theory). See also epidemic.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The branch of a science dealing with the spread and control of diseases, viruses, concepts etc. throughout populations or systems\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The epidemiological body of knowledge about a particular thing\", \"priority\":2}]}, \"synonyms\":{}}");

