	add("epigenesis", "{\"term\":\"epigenesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|epi|genesis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The theory that an organism develops by differentiation from an unstructured egg rather than by simple enlarging of something preformed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Terence Allen and Graham Cowling, \u0027The Cell: A Very Short Introduction\u0027, Oxford 2011, p. 100\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Ignored for two millennia, Aristotle, in his book \u0027On the Generation of Animals\u0027, first proposed the theory of \u0027\u0027epigenesis\u0027\u0027 in biology, suggesting that development of a plant or animal from an egg or spore follows a sequence of steps in which the organism changes and the various organs form\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"changes in the mineral content of rock after its formation\", \"priority\":4}]}, \"synonyms\":{}}");

	add("epigenetics", "{\"term\":\"epigenetics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|epigenesis|genetics|lang\u003den}}; coined by w:C. H. Waddington|C. H. Waddington in 1942.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the processes involved in the genetic development of an organism, especially the activation and deactivation of genes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027 November 6, \u0027Sins of the Fathers\u0027, in \u0027w:New New Scientist\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Epigenetics\u0027\u0027 deals with the regulation of genetic activity within a cell - which genes are switched on or off, and when it happens\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The study of heritable changes caused by the activation and deactivation of genes without any change in DNA sequence\", \"priority\":4}]}, \"synonyms\":{}}");

