	add("epigenomics", "{\"term\":\"epigenomics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the effects of chromatin structure on the function of the included genes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Epigenomics\u0027\u0027 can be termed as the study of the effects of chromatin structure, including the higher order of chromatin folding and attachment to the nuclear matrix, packaging of DNA around nucleosomes, covalent modifications of histone tails and DNA methylation. --Gomase \u0026amp; Tagore\", \"priority\":2}]}, \"synonyms\":{}}");

	add("epiglottis", "{\"term\":\"epiglottis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From {{m|la|epiglottis}}, from Ancient greek (to 1453) {{m|grc|ἐπιγλωττίς}}, from {{m|grc|ἐπί|gloss\u003don}} + {{m|grc|γλῶττίς|gloss\u003dglottis}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cartilaginous organ in the throat of terrestrial vertebrates covering the glottis when swallowing to prevent food and liquid from entering the trachea, and in Homo sapiens also a speech organ\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Jeremy Clarkson, \u0027Top Gear\u0027 Series 5, Episode 9\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"My \u0027\u0027epiglottis\u0027\u0027 is full of bees\", \"priority\":3}]}, \"synonyms\":{}}");

