	add("epigram", "{\"term\":\"epigram\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027épigramme\u0027 from Latin \u0027epigramma\u0027 () from Ancient greek (to 1453) \u0027ἐπίγραμμα\u0027 (inscription)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An inscription in stone\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A brief but witty saying\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A short, witty or pithy poem\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"When an \u0027\u0027epigram\u0027\u0027 one\u0027s composin\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"brevity is key\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"of stanzas: one should be chosen\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"and of lines: one more than three\", \"priority\":7}]}, \"synonyms\":{}}");

	add("epigrammatism", "{\"term\":\"epigrammatism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The use of epigrams; epigrammatical character\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The work is rather too light, and bright, and sparkling; it wants shade; it wants to be stretched out here and there with a long chapter of sense, if it could be had; if not, of solemn specious nonsense, about something unconnected with the story; an essay on writing, a critique on Walter Scott, or the history of Buonaparte, or something that would form a contrast, and bring the reader with increased delight to the playfulness and \u0027\u0027epigrammatism\u0027\u0027 of the general style\", \"priority\":2}]}, \"synonyms\":{}}");

